import React, { useState } from 'react';
import { DropdownButton, Dropdown } from 'react-bootstrap';

function TestC() {
  const [selectedMonth, setSelectedMonth] = useState('');

  const handleMonthChange = (eventKey, event) => {
    setSelectedMonth(eventKey);
  };

  const months = Array.from(new Set(dataSource.datasets[0].month));

  return (
    <DropdownButton id="monthDropdown" title={`Select Month: ${selectedMonth || 'All Months'}`} onSelect={handleMonthChange}>
      <Dropdown.Item eventKey="">All Months</Dropdown.Item>
      {months.map((month) => (
        <Dropdown.Item key={month} eventKey={month}>
          {month}
        </Dropdown.Item>
      ))}
    </DropdownButton>
  );
}

export default TestC;
